import React from 'react'
import { useSelector } from 'react-redux'
import { currentType } from '../../types/Types'
import { useProfile } from './profile.hook'
import "./Profile.css"

const Profile = () => {
    const exit = useProfile()
    // const {current}: currentType = useSelector((state : {current: currentType}): currentType => state.current)
    const {current} = useSelector((state : {current: currentType}) => state.current)

    return (
    <div>
        <h4>{current.name}</h4>
        <h4>{current.email}</h4>
        <button className='exit' onClick={exit}>Exit</button>
    </div>
  )
}

export default Profile
